import React, { Component } from "react";
import { PieChart } from 'react-minimal-pie-chart';
    

export default class Usage extends Component {


    constructor(props) {
        super(props);
      }

    /*comp() {

        userid = this.props.userid
        const requestOptions = {
            method: 'POST',
            headers: { 'Access-Control-Request-Method': 'POST'
            , 'Access-Control-Request-Headers': '*'},
            body: JSON.stringify({ 
                'email': "hello",
                'password': "jsk"
              })
        };
        uri_link = 'https://86wu00bura.execute-api.us-east-1.amazonaws.com/v1/users/'+userid
        fetch(uri_link, requestOptions)
        .then(response => {
            const data = response.json();

            // check for error response
            if (!response.ok) {
                // get error message from body or default to response statusText
                const error = response.statusText
                return Promise.reject(error);
            }

            this.setState({isLoggedIn: true, userName: this.state.userName, password: this.state.password, erroruserName: this.state.erroruserName, errorPassword: this.state.errorPassword})
        })
        .catch(error => {
            console.error('There was an error!', error);
            alert('Invalid credentials ! Please try again.')
        });

    }*/


    render(){
        console.log("Hello")
        console.log(this.props.location.userid)
        return(
            <div>
                <div className="row">
                    
                    <div className="col-md-12">
                        <div className="row">
                        <span>Subscription type: </span>&nbsp;&nbsp;&nbsp;Basic
                        </div>
                        &nbsp;
                        <div className="row">
                        <span>Subscription Usage: </span><span>
                            
                            <PieChart
                                data={[
                                    { title: '100%', value: 10, percentage: 100, color: '#006600' }
                                ]}  animate
                                animationDuration={500}
                                animationEasing="ease-out" label={(data) => data.dataEntry.title} labelStyle={{
                                    fontSize: "8px",
                                    fontColor: "FFFFFA",
                                    fontWeight: "800",
                                  }} lineWidth={100} reveal={100} radius={35}
                            /></span>
                        </div>
                    </div>
                    
                </div>
            </div>
        )  
    }
}
